import React, {useState} from "react";

import LineTitle from "../Components/LineTitle"

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope, faPhone } from '@fortawesome/free-solid-svg-icons'

function GetInTouch() {
    const [style1, setStyle1] = useState({display: 'none'});
    const [style2, setStyle2] = useState({display: 'block'});

    return(
        <div 
            onMouseEnter={e => {
                setStyle1({display: 'block'});
                setStyle2({display: 'none'});
            }}
            onMouseLeave={e => {
                setStyle1({display: 'none'});
                setStyle2({display: 'block'});
            }} 
            className="Contact outer"
        >   
        <div className="outer"></div>         
            <div className="middle" style={style2}>
                <div className="inner">
                    <LineTitle  NoLine={true} Light={false} Title="Get In Touch!"/>
                </div>
                <div style={style1} className="inner DisplayContact VySmFont">
                    <a href="tel:+91-9910584860" className="FontAwesomeIcon MdFont NavBarText">
                        <FontAwesomeIcon icon={faPhone} />
                    </a>
                    <a className="FontAwesomeIcon MdFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>
                        <FontAwesomeIcon icon={faEnvelope} />
                    </a>
                </div>             
            </div>
        </div>
    );
}

export default GetInTouch;
